import { useEffect, useState } from "react";
import styled from "styled-components";

const TodoGrid = styled.section`
    display: grid;
    width: 100%;
    grid-template-columns: repeat(4, 1fr);
    gap:10px;
`

const TodoBox = styled.div`
    display: flex;
    justify-content: center;
    flex-direction: column;
    min-height: 70px;
    max-height: 100px;
    border: 1px black solid;
    border-radius: 10px;
    background-color: white;
    overflow: auto;
`

const TodoText = styled.div`
    text-align: center;
    background-color: white;
`

const DelBtn = styled.button`
    position: relative;
    width: 40px;
    height: 25px;
    border-radius: 10px;
    text-align: center;
    background-color: #FFE0E6;
    color: #F32D67;
    right: -158px;
    bottom: -2px;
    :active{
        background-color: #EFEFEF;
    }
`

function Todo () {
    const [todos, setTodos] = useState("")

    useEffect(()=> {
        fetch("http://localhost:3001/todos", {
            method: "GET"
        })
            .then((res)=> {
                if (!res.ok){
                    throw Error("위잉 위잉 에러에요");
                }
                return res.json();
            })
            .then((data) => {
                setTodos(data);
            })
            .catch((err)=>{
                console.log(err)
            })
    }, [])
    console.log(todos)
    return (
        <TodoGrid>
            {todos.map((todo)=>(
                <TodoBox>
                    <TodoText>{todo.todo}</TodoText>
                    <DelBtn>DEL</DelBtn>
                </TodoBox>
            ))}
            <TodoBox>
                <TodoText> 1. C </TodoText>
                <DelBtn> DEL</DelBtn>
            </TodoBox>
            <TodoBox>
                <TodoText> 2. D </TodoText>
                <DelBtn> DEL</DelBtn>
            </TodoBox>
            <TodoBox>
                <TodoText> 3. U </TodoText>
                <DelBtn> DEL</DelBtn>
            </TodoBox>
            <TodoBox>
                <TodoText> 4. Design </TodoText>
                <DelBtn> DEL</DelBtn>
            </TodoBox>

        </TodoGrid>
    )
}

export default Todo;
